import React from 'react';
import './Climb.css';
import ClimbInstance from '../ClimbInstance/ClimbInstance';



const Climbs = (props) => {

    const addLike = (climb) => {
      alert('like added from climbs component');
      props.addLike();
    }

    return props.climbList.map((climb, index) => (
      <ClimbInstance climb={climb} onClick={addLike}/>

      ));



};

export default Climbs;
